import { useEffect, useState } from 'react';

// material-ui
import { Grid } from '@mui/material';

// project imports
import EarningCard from './EarningCard';
import PopularCard from './PopularCard';
import TotalOrderLineChartCard from './TotalOrderLineChartCard';
import TotalIncomeDarkCard from './TotalIncomeDarkCard';
import TotalIncomeLightCard from './TotalIncomeLightCard';
import TotalGrowthBarChart from './TotalGrowthBarChart';
import { gridSpacing } from 'store/constant';

let  elements  = [
    {

        render:()=>{
            return (
                <div class="ui two column grid">
                <div className="row">
                    <CardGroup itemsPerRow={2}>
                    <div className="column"></div>
                    <CompanyItem key={1} name={companies[1]} reputation={reputation[1]}/>
                    <div className="column"></div>
                    <CompanyItem key={2} name={companies[2]} reputation={reputation[2]}/>
                    </CardGroup>
                </div>

                </div>

            )
        }

    },

    {
        render:()=>{
            return (
                <div class="ui two column grid">
                <div className="row">
                    <CardGroup itemsPerRow={2}>
                    <div className="column"></div>
                    <CompanyItem key={3} name={companies[3]} reputation={reputation[3]}/>
                    <div className="column"></div>
                    <CompanyItem key={4} name={companies[4]} reputation={reputation[4]}/>

                    </CardGroup>
                </div>

                </div>

            )
        }
    },
    {
        render:()=>{
            return (
                <div class="ui two column grid">
                <div className="row">
                    <CardGroup itemsPerRow={2}>
                    <div className="column"></div>
                    <CompanyItem key={5} name={companies[2]} reputation={reputation[2]}/>
                    <div className="column"></div>
                    <CompanyItem key={6} name={companies[3]} reputation={reputation[3]}/>
                    </CardGroup>
                </div>

                </div>

            )
        }
    }
]

const Dashboard = () => {
    const [isLoading, setLoading] = useState(true);
    useEffect(() => {
        setLoading(false);
    }, []);

    return (
        <Grid container spacing={gridSpacing}>
            <Grid item xs={12}>
                <Grid container spacing={gridSpacing}>
                    <Grid item lg={4} md={6} sm={6} xs={12}>
                        <EarningCard isLoading={isLoading} />
                    </Grid>
                    <Grid item lg={4} md={6} sm={6} xs={12}>
                        <TotalOrderLineChartCard isLoading={isLoading} />
                    </Grid>
                    <Grid item lg={4} md={12} sm={12} xs={12}>
                        <Grid container spacing={gridSpacing}>
                            <Grid item sm={6} xs={12} md={6} lg={12}>
                                <TotalIncomeDarkCard isLoading={isLoading} />
                            </Grid>
                            <Grid item sm={6} xs={12} md={6} lg={12}>
                                <TotalIncomeLightCard isLoading={isLoading} />
                            </Grid>
                        </Grid>
                    </Grid>
                </Grid>
            </Grid>
            <Grid item xs={12}>
                <Grid container spacing={gridSpacing}>
                    <Grid item xs={12} md={8}>
                        <TotalGrowthBarChart isLoading={isLoading} />
                    </Grid>
                    <Grid item xs={12} md={4}>
                        <PopularCard isLoading={isLoading} />
                    </Grid>
                </Grid>
            </Grid>
        </Grid>
    );
};

export default Dashboard;
